import fetch from 'isomorphic-unfetch'
import React, { Component } from 'react';

class Index extends Component {


    render() {
        const { posts } = this.props
        return (
            <div>
                <h1>Our Index Page!!</h1>
                <ul>
                    {posts.map(p => (
                        <li key={p.id}>{p.title}</li>
                    ))}
                </ul>
            </div>
        );
    }
}



